      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE ( col1 ) NOT BETWEEN ( + - CAST ( NULL AS REAL ) * col0 + 60 + 77 ) AND ( + col0 );
  - name: tab2

outputs:
  - name: q9137.out
    data: |
      46	51	23
      64	77	40
